import React from "react";

const Login = ({ toggleLogin }) => {
  return (
    <div>
      <div className="flex justify-center bg-gray-900 h-full w-full z-50">
        <div className="absolute top-[40vh]  z-50 bg-white">
          <h1>Kite</h1>
          <p>Please sign in</p>
          <p>Username or Email</p>
          <input type="text" placeholder="Enter username or email..." />
          <p>Password</p>
          <input type="password" placeholder="Enter password..." />
          <button
            onClick={() => {
              toggleLogin(1);
            }}
          >
            Sign in
          </button>
        </div>
      </div>
    </div>
  );
};

export default Login;
